import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import "./ViewDataPage.css";

const ViewDataPage = () => {
    const [uploads, setUploads] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        // Normally, you'd fetch the uploads from a backend or state here
        const savedUploads = [
            {
                date: "Mon Sep 12 2024",
                text: "Today I learned React!",
                images: ["path-to-image1.jpg", "path-to-image2.jpg"]
            },
            // Add more entries as examples
        ];
        setUploads(savedUploads);
    }, []);

    const handleBack = () => {
        navigate("/");
    };

    return (
        <div className="view-data-page">
            <h1>Uploaded Data</h1>
            <button onClick={handleBack}>Back to Calendar</button>
            {uploads.map((upload, index) => (
                <div key={index} className="entry">
                    <h3>{upload.date}</h3>
                    <p>{upload.text}</p>
                    <div className="image-gallery">
                        {upload.images.map((img, imgIndex) => (
                            <img key={imgIndex} src={img} alt={`Upload ${imgIndex}`} />
                        ))}
                    </div>
                </div>
            ))}
        </div>
    );
};

export default ViewDataPage;
